import { Checkbox, DropDown, InputWithMovingLabel } from "intelli-ui-components-library";
import styles from './addsecurityscheme.module.scss'
import APIType from "./typeselection/APIType";
import OpenidType from "./typeselection/OpenidType";
import AuthenticationType from "./typeselection/AuthenticationType";
import OAuthType from "./typeselection/OAuthType";
import TypeDescription from "./typeselection/TypeDescription";
import { useAppSelector,useAppDispatch } from "../../store/hooks";
import { securityData } from "../../store/reducers/securitySlice";
import { CopyIcon, DeleteIcon } from "../../assets/icons";
import { useEffect, useState } from "react";
import { exportData } from "../../store/reducers/exportSlice";
interface AddSecuritySchemeProps {
    schemeKey:string
    index:number
}
const AddSecurityScheme:React.FC<AddSecuritySchemeProps> = ({schemeKey,index}) => {
    const securityScheme = useAppSelector(state => state.security.securitySchemes);
    const securityPath = useAppSelector(state=>state.export);
    const exportObj = {...securityPath}
    const newSecurityPath = [...exportObj.security]
    const [checkPath, setCheckPath] = useState(false)
    const dispatch = useAppDispatch();
    const securityObj = {...securityScheme}
    const addSchemeObj = {...securityObj[schemeKey]}
    const optionList = [
        { label: "API key", key: "apiKey" },
        { label: "oAuth2", key: "oauth2" }, 
        { label: "HTTP Authentication", key: "http" }, 
        { label: "OpenIdConnect", key: "openIdConnect" },
    ];
    const handleOnNamechange = (e: any) => {
            const oldVlaue = {...securityObj[schemeKey]}
            const newKey = e.target.value
            const keyValues = Object.entries(securityObj);     
            keyValues.splice(index,1, [newKey,oldVlaue]);
            const newObj = Object.fromEntries(keyValues)
            dispatch(securityData({...newObj}))
    }
    const onChange = (e: any) => {
       const newType = e.key
       addSchemeObj["type"] = newType
       securityObj[schemeKey] = addSchemeObj
       dispatch(securityData({...securityObj}))
    }
    const deleteScheme = () => {
        const keyValues = Object.entries(securityObj);     
        keyValues.splice(index,1);
        const newObj = Object.fromEntries(keyValues)
        dispatch(securityData({...newObj}))
    }
    const obj = {
        apiKey: <APIType securityObj={securityObj} schemeKey={schemeKey}/>,
        oauth2: <OAuthType securityObj={securityObj} schemeKey={schemeKey}/>,
        http: <AuthenticationType securityObj={securityObj} schemeKey={schemeKey}/>,
        openIdConnect: <OpenidType securityObj={securityObj} schemeKey={schemeKey}/>
    };
    const selectedComponent = obj[addSchemeObj.type];

    const onCheckPath = (e:any,key:string) => {
        const selectValue = e.target.checked;
        setCheckPath(selectValue);
        if(selectValue)
        {   
            const newObj = {[key]:[]}
            if(newSecurityPath.length>0)
            {
                newSecurityPath.push(newObj)
                exportObj["security"]=newSecurityPath
            }
            else
            {
                const newPath = [newObj]
                exportObj["security"]=newPath
            }
            dispatch(exportData({...exportObj}))
        }
        else{
            newSecurityPath.forEach((obj,index)=>{
                if(obj.hasOwnProperty(schemeKey))
                        {   
                         newSecurityPath.splice(index, 1);
                         console.log("newSecurityPath2",newSecurityPath)
                         exportObj["security"] = newSecurityPath
                         dispatch(exportData({...exportObj}))
                        }
                    })
              
        }  
    }
    useEffect(()=>{
        exportObj &&  exportObj["security"].map((obj)=>{
            if(obj.hasOwnProperty(schemeKey))
                    {   
                    setCheckPath(true)
                    }
                })
    },[])
    return (
        <div className={styles["security-container"]} >
            <div className={styles["security-header"]}>     
                <InputWithMovingLabel
                    inputProps={{
                        type: "text",
                        value: schemeKey,
                        name: schemeKey,
                        label: "Name",
                        onChange: handleOnNamechange,
                        className: styles["header-input"]
                    }}
                    top={true}

                />
                <DropDown
                    value={addSchemeObj.type}
                    optionList={optionList}
                    onChange={onChange}
                    label="Type"
                />
                <Checkbox 
                    checked={checkPath}
                    value="Apply to all paths" 
                    onChange={(e)=>onCheckPath(e,schemeKey)}
                    
                />
                <div className={styles["security-copyicon"]} >
                {/* <span className={styles["copy-icon"]}><CopyIcon fill="#FFFFFF" width="20px" height="20px"/></span> */}
                <button className={styles["delete-icon"]} onClick={deleteScheme}><DeleteIcon fill="#FFFFFF" width="20px" height="20px"/></button>
                </div>
            </div>
            <div>
                {selectedComponent}
            </div>

        </div>
    )
}

export default AddSecurityScheme;
